"use client"
import "./App.css";
import { GoogleOAuthProvider, GoogleLogin } from "@react-oauth/google";

function App() {

  return (
    <div className="App">

        <h1>Welcome</h1>
         <GoogleOAuthProvider
           clientId={process.env.REACT_APP_GOOGLE_CLIENT_ID}
         >
           <GoogleLogin
             onSuccess={async (credentialResponse) => {
               console.log(credentialResponse);
                         }}
             onError={() => {
               console.log("Login Failed");
             }}
           />
         </GoogleOAuthProvider>

    </div>
  );
}

export default App;
